def case_sensitive(s):
    result = [char for char in s if char.isupper()]
    return [ result == [], result ]

def case_sensitive(s):
    l = [x for x in s if x.isupper()]
    return [l == [], l]

def case_sensitive(s):
    lst = [x for x in s if x.isupper()]
    return [len(lst) == 0, lst]

def case_sensitive(s):
    res = list(filter(str.isupper, s))
    return [not res, res]

def case_sensitive(s):
    x = [c for c in list(s) if not c.islower()]
    return [not bool(x), x]

def case_sensitive(s):
    uppers = [c for c in s if c.isupper()]
    return [not uppers, uppers]
